// baby blue #1498D5 concentration 40%
// very light grey #8D9BA1 concentration 15%

export default {
  blue: "#1498D5",
  get myblue() {
    return this.blue;
  },
  set myblue(value) {
    this.blue = value;
  },
  dark_grey: "#707070",
  black: "#000",
  white: "#fff",
  text_holder: "#606162",
  myyellow: "#D7A723",
};
